import React from 'react';
import { useNavigate } from 'react-router-dom';

export default function AdminDashboard() {
  const navigate = useNavigate();

  const handleLogout = () => {
    // Supprimer token ou données utilisateur si besoin
    localStorage.removeItem('token'); // ou autre clé que tu utilises

    // Rediriger vers la page de login
    navigate('/login');
  };

  return (
    <div style={{ padding: 20, maxWidth: 400, margin: 'auto', textAlign: 'center' }}>
      <h1>Dashboard Admin</h1>
      <p>Bienvenue sur la page admin.</p>

      <button
        onClick={handleLogout}
        style={{
          marginTop: 30,
          padding: '12px 30px',
          backgroundColor: '#d9534f',
          color: 'white',
          border: 'none',
          borderRadius: 8,
          cursor: 'pointer',
          fontWeight: 'bold',
          fontSize: 16,
          boxShadow: '0 4px 8px rgba(0,0,0,0.2)',
          transition: 'background-color 0.3s ease',
        }}
        onMouseOver={e => (e.currentTarget.style.backgroundColor = '#c9302c')}
        onMouseOut={e => (e.currentTarget.style.backgroundColor = '#d9534f')}
      >
        Déconnexion
      </button>
    </div>
  );
}
